DROP DATABASE IF EXISTS photosdb;
CREATE DATABASE photosdb;
USE photosdb;

DROP TABLE IF EXISTS `photos`;
CREATE TABLE `photos` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `restaurant` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `url` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `timestamp` date NOT NULL,
  `unrelated_report` int(11) DEFAULT NULL,
  `inappropriate_report` int(11) DEFAULT NULL,
  `dislike` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

DROP TABLE IF EXISTS `info`;
CREATE TABLE `info` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `address` varchar(255) NOT NULL,
  `cross-street` varchar(255) NOT NULL,
  `neighborhood` varchar(255) NOT NULL,
  `hours-of-operation` varchar(255) NOT NULL,
  `cuisines` varchar(255) NOT NULL,
  `dining-style` varchar(255) NOT NULL,
  `dress-code` varchar(255) NOT NULL,
  `payment-options` varchar(255) NOT NULL,
  `executive-chef` varchar(255) NOT NULL,
  `additional` varchar(255) NOT NULL,
  `website` varchar(255) NOT NULL,
  `phone-number` varchar(255) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8;


